import React from "react";
import { Route, Switch } from "react-router-dom";

import Signup from "./Signup";
import Signin from "./Signin";
import Header from "./Header";
import Home from "./Home";
import Showquiz from "./Showquiz";
import Quizset from "./Quizset";
import Createquiz from "./Createquiz";
import Showmarks from "./Showmarks";
import Profile from "./Profile";
import Notfound from "./Notfound";

class App extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      islogged: false
    };
  }

  handleIslogged = value => {
    this.setState({ islogged: value });
  };

  PublicRoutes() {
    return (
      <>
        <Switch>
          <Route path="/" exact>
            <Header /> <Home />
          </Route>

          <Route path="/signup" exact handleIslogged={this.handleIslogged}>
            <Header /> <Signup />
          </Route>
          <Route exact path="/signin">
            <Signin handleIslogged={this.handleIslogged} />
          </Route>
          <Route
            handleIslogged={this.handleIslogged}
            path="/admin/login"
            component={Signin}
            exact
          />
          <Route path="/*" exact component={Notfound} />
        </Switch>
      </>
    );
  }
  PrivateRoutes() {
    return (
      <>
        <Switch>
          <Route path="/" exact>
            <Header /> <Home />
          </Route>
          <Route path="/quizsets" exact component={Quizset} />
          <Route path="/myprofile" exact component={Profile} />
          <Route path="/createquiz" exact component={Createquiz} />
          <Route path="/quizsets/:quizname" exact component={Showquiz} />
          <Route path="/users/:username/marks" exact component={Showmarks} />
          <Route path="/*" exact component={Notfound} />
        </Switch>
      </>
    );
  }

  render() {
    return (
      <div className="whole-app">
        {localStorage.quizuserToken
          ? this.PrivateRoutes()
          : this.PublicRoutes()}
      </div>
    );
  }
}
export default App;
